from time import time


class Solution:
    def checkInclusion(self, s1: str, s2: str) -> bool:
        if len(s1) > len(s2):
            return False
        dict_s1 = {}
        for s in s1:
            dict_s1[s] = dict_s1.get(s, 0) + 1
        copy_dict = dict_s1.copy()
        first = None
        for i in range(len(s2)):
            remain = copy_dict.get(s2[i])
            if remain == 0:
                for j in range(first, i):
                    copy_dict[s2[j]] += 1
                    first += 1
                    if s2[i] == s2[j]:
                        break
            if remain is None:
                if first is not None:
                    copy_dict = dict_s1.copy()
                    first = None
                continue
            if first is None:
                first = i
            copy_dict[s2[i]] -= 1
            if not any(copy_dict.values()):
                return True
        return False


start_time = time()

_s1 = ""
_s2 = ""

print(Solution().checkInclusion(_s1, _s2))

print("--- %s seconds ---" % (time() - start_time))
